import "./Header.css"
const Header = () => {
  return (
    <div className='header d__flex align__items__center justify__content__space__between'>
        <div className='header__left__items d__flex align__items__center '>
            <div className='menubar'>
            
            </div>
        </div>
    </div>
  )
}

export default Header
